import React from "react";
import Navbar from "./Navbar";
import Hero from "./Hero";
import Card from "./Card";
import swimmer from "../../public/img/swimmer.png";
function App() {
  return (
    <div>
      <Navbar />
      <Hero />
      <Card
        img={swimmer}
        rating="5.0"
        reviewCount="(6)"
        country="USA"
        title="Life lessons with Katie Zaferes"
        price={136}
      />
      <Card />
    </div>
  );
}

export default App;
